import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';

// Create a basic home page component
const HomePage: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Welcome to Questomer</h1>
      <p>Your startup-investor matching platform</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/login" style={{ color: 'white', margin: '10px' }}>Login</a>
        <a href="/register" style={{ color: 'white', margin: '10px' }}>Register</a>
      </div>
    </header>
  </div>
);

// Create a basic error/not found component
const NotFound: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>404 - Page Not Found</h1>
      <p>The page you are looking for doesn't exist.</p>
      <a href="/" style={{ color: 'white', marginTop: '20px' }}>Return to Home</a>
    </header>
  </div>
);

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
